import React from "react";
import styled from "styled-components";

const DotsBox = styled.div`
  height: 54px;
  position: relative;
  border: 2px solid red;
`;

const Dot = styled.span`
  width: 40px;
  height: 40px;
  background-color: var(--color-brown);
`;

const Dots = () => {
  return (
    <DotsBox>
      <Dot></Dot>
      <Dot></Dot>
      <Dot></Dot>
    </DotsBox>
  );
};

export default Dots;
